import React from 'react';
import { NavLink } from 'react-router-dom';

class Navigation extends React.Component {
    constructor(props){
        super(props)
    }
    render(){
        return <div id='nani' style={styles.wraper}>
            <NavLink style={styles.comps} to='/'><strong>Home</strong></NavLink>
            <NavLink style={styles.comps} to='/Calculator'><strong>Calculator</strong></NavLink>
            <NavLink style={styles.comps} to='/GraphDisplay'><strong>Display Graph</strong></NavLink>
            <NavLink style={styles.comps} to='/Zeros'><strong>Find Zeros</strong></NavLink>
        </div>
    }
}

const styles={
    wraper: {
        display: 'flex',
        flexDirection: 'row',
        height: 80,
        alignItems: 'center',
        margin: 20,
        borderWidth: 20,
        borderColor: 'black',
        borderRadius: 4
    },
    comps: {
        margin: 20,
        color: 'green'
    }
}

export default Navigation;
